import { Schema, model, } from "mongoose";
import bcrypt from 'bcryptjs';

const userSchema = new Schema({
    username: {
        type: String,
        unique: true
    },
    email: {
        type: String,
        unique: true
    },
    password: {
        type: String,
        required: true
    },
    roles: [{
        ref: "Role",
        type: Schema.Types.ObjectId
    }]
}, {
    timestamps: true,
    versionKey: false
});


// GENERAMOS MTODOS PERSONALIZADOS

// Creamos el mtodo para cifrar la contrasea
// Llamando al 'static' podemos llamar al mtodo sin necesidad de instanciar el objeto
userSchema.statics.encryptPassword = async(password) => {

    // Con 'genSalt' ejecutaremos el algoritmo tantas veces como le indiquemos.
    // Ms veces = Ms seguridad && Ms consumo en el servidor
    const salt = await bcrypt.genSalt(10);

    // Crearemos una contrasea cifrada HASH aadiendo el salt al final y la retornamos.
    return await bcrypt.hash(password, salt);

};

// Creamos un mtodo para comparar la contrasea
userSchema.statics.comparePassword = async(password, receivedPassword) => {

    return await bcrypt.compare(password, receivedPassword);

};


export default model('User', userSchema);

